const ProductList = ()=>{
    const [products, setProducts] = useState([]);

    useEffect(()=>{
        getData()
    },[])

    const getData = async()=>{
        let result = await fetch("http://localhost:5000/products");
        result = await result.json();
        setProducts(result);
    }

    const deleteProduct = ()=>{
        // let result = await fetch("http://localhost:5000/product")
    }

    return(
        <div className="product-list">
        <h3>Product List</h3>
        <ul>
            <li>S.No</li>
            <li>Name</li>
            <li>Price</li>
            <li>Category</li>
            <li>Company</li>
            <li>Operation</li>
        </ul>
        {
            products.map((item,index)=>{
                return(
                <ul key={item._id}>
                    <li>{index+1}</li>
                    <li>{item.name}</li>
                    <li>{item.price}</li>
                    <li>{item.category}</li>
                    <li>{item.company}</li>
                    <li><button onClick={deleteProduct}>delete</button></li>
            </ul>
                )
            })
        }
       
        </div>
    )
}

export default ProductList;
